import classes from "./Test.module.css";


const Test = () => {
  // bracket [ round [ ]]
  const [bracket, setBracket] = useState([ [{'first': 'Bill', 'second': 'Bill'}, {'first': 'Bill', 'second': 'Bill'}], [{'first': 'Bill', 'second': 'Bill'}]]);


  return (
    <section>
      <div className={`${classes.bracket}`}>
        {bracket.map((round) => {
          <div className={`${classes.column}`}>
          { round.map((match) => {
              <div className={`${classes.match}`}>

              </div>
              console.log('match', match)
          })}
          </div>
        }
        )}
      </div>
    </section>
  );
};

export default Test;
